import { Helmet } from "react-helmet";
import React from 'react'

const Meta = (props) => {
  return (
    <Helmet>
    <meta charSet='utf-8' />
    <title>{props.title}</title>
    <div className="stop-wrapper py-5">

    </div>
  </Helmet>
  )
}

export default Meta
